Before we jump into the meat of Systems Architecture, let me quickly show you a snippet showcasing how working with Systems looks like in a gist: Click to unfold code snippet // Actor componetns are treated as data/tags put on actors, that user reads from
// or writes to, using system queries.
UCLASS(BlueprintType, Blueprintable, Meta = (BlueprintSpawnableComponent))
class EXAMPLE_API UPlayerComponent : public USystemsActorComponent
{ GENERATED_BODY()
}; UCLASS(BlueprintType, Blueprintable, Meta = (BlueprintSpawnableComponent))
class EXAMPLE_API UEnemyComponent : public USystemsActorComponent
{ GENERATED_BODY()
}; // System are usually lambdas/functions that process chunks of systems world
// data (it can be querying actor components, managing resources or just
// processing some data - the point is we focus on processing game data, no
// matter its form).
void HuntSystem(USystemsWorld& Systems)
{ const auto DeltaTime = Systems.GetWorld()->GetDeltaSeconds(); // Systems Architecture adds an interface over game world that allows us to // treat it as database that we can query, also rather than putting logic // into each object, we rather perform batched data processing on a set of // requested components. Systems .Query<UPlayerComponent>() // We use powerful lazy-iterators to ease our work on batched data // processing. this one is one of many consumer iterators and it's job // is to go through all yielded iterator values and make user do // something useful with these, just like with regular for-in loops. .ForEach( [](auto& PlayerData) { // queries always yield tuple with actor that owns components // requested for query, in addition to following components. auto* PlayerActor = PlayerData.Get<0>(); const auto PlayerPosition = PlayerActor->GetActorLocation(); const auto Nearest = Systems .Query<UEnemyComponent>() // mapping iterator is one of the most commonly used // types of iterators that transform data from one form // to another, usually to get exact information needed // by next iterators in chain, or to just process it and // collect the result. .Map<TTuple<FVector, float>>( [&](const auto& EnemyData) { const auto* EnemyActor = EnemyData.Get<0>(); const auto EnemyPosition = EnemyActor->GetActorLocation(); const auto Distance = FVector::Distance(PlayerPosition, EnemyPosition); return MakeTuple(EnemyPosition, Distance); }) // finding the nearest enemy based on distance extracted // in previous iteration step. .ComparedBy( [](const auto& A, const auto& B) { const auto DistanceA = A.Get<1>(); const auto DistanceB = B.Get<1>(); return DistanceA < DistanceB; }); if (Nearest.IsSet()) { const auto TargetPosition = Nearest.GetValue().Get<0>(); const auto Direction = (TargetPosition - PlayerPosition).GetSafeNormal(); const auto Velocity = Direction * 100.0f * DeltaTime; PlayerActor->SetActorLocation(PlayerPosition + Velocity); } });
} UCLASS()
class EXAMPLE_API UExampleGameInstance : public UGameInstance
{ GENERATED_BODY() private: virtual void Init() override;
}; void UExampleGameInstance::Init()
{ Super::Init(); auto* Subsystem = USystemsSubsystem::Get(GetWorld()); if (IsValid(Subsystem)) { Subsystem->AcquireSystemsWorld(FName(), [&](auto& Systems) { // Due to how queries are resolved, we need to register all // components we might want to query. Systems.RegisterComponent<UPlayerComponent>(); Systems.RegisterComponent<UEnemyComponent>(); // Persistent systems (ones that will run on every game tick) // have to be registered in systems world. There are many types // of systems, but commonly used ones are state-less // lambda/function systems. System labels // ("Hunt") are used for resolving systems dependency graph // (user can provide sets of systems that given one has to run // before and after). Systems.InstallLambdaSystem(HuntSystem, FInstallSystemOptions("Hunt")); }); }
}

